import{e as t,o as l,f as o,g as r,a as e,h as s,C as n,k as u}from"./index.6938427d.js";const c={class:"wrapper"},d=e("div",{class:"absolute-bottom bg-transparent text-h3 text-uppercase text-center"}," Gallerie ",-1),p=e("h4",{class:"q-pa-md q-pt-xl text-uppercase text-weight-light"},"On parle de nous",-1),m={class:"q-px-md q-pl-lg"},h=e("h5",{class:"text-brand q-py-lg"},"Les chambres d'h\xF4tes f\xE9\xE9riques re\xE7oivent leur 5\xE8me \xE9pis.",-1),g=e("p",null," Des moments uniques dans un cadre f\xE9erique\u2026 Dans ce cadre naturel et encore pr\xE9serv\xE9 par la folie du monde actuel, \xABla f\xE9e de la maison \xBB a souhait\xE9 conserver les valeurs des si\xE8cles pass\xE9s tout en int\xE9grant le confort actuel pour combler les attentes de ses h\xF4tes, m\xEAme les plus exigeants. Depuis 25 ans, Isabelle travaille dans les m\xE9tiers de l\u2019h\xF4tellerie de standing. En cr\xE9ant ce lieu, son r\xEAve se r\xE9alise enfin d\u2019accueillir et de choyer ses propres clients. ",-1),_=e("p",null,[u("Article du Pays Dolois du 25 mars 2021 (page 20 \xE0 22) "),e("a",{href:"https://issuu.com/paoh/docs/pays-dolois-235_1bb8878d5d9e98"},"Voir l'article")],-1),q=e("section",{class:"q-px-md q-pl-lg"},[e("h5",{class:"text-brand-2 q-py-lg"},"Le Domaine des F\xE9es... Une soixantaine de demandes en mariage en 13 ans..."),e("a",{href:"https://www.leprogres.fr/insolite/2020/07/12/le-domaine-des-fees-theatre-d-une-soixantaine-de-demandes-en-mariage-en-13-ans"},"Voir l'article")],-1),v={class:"q-px-md q-pl-lg"},f=e("h5",{class:"text-brand q-py-lg"},"Titre",-1),x=e("p",null,"Article du Progr\xE8s.fr du 29 ao\xFBt 2021 ",-1),b={class:"q-px-md q-pl-lg"},y=e("h5",{class:"text-brand-2 q-py-lg"},"Myriam Eckert redonne une seconde vie aux arbres touch\xE9s par la maladie des fr\xEAnes.",-1),j=e("p",null,"L\u2019histoire a commenc\xE9 il y a quelques semaines. Une vie d\u2019arbres qui se prolongera en conte de f\xE9es, pour une \xE0 eux d\xE9cennies encore. Par De notre correspondant, Jacques FAIVRE.",-1),L=e("p",null," \xAB J\u2019aime tant la nature. Je voulais rendre hommage \xE0 ces arbres, pour ces ann\xE9es, en leur donnant une deuxi\xE8me vie, d\xE9taille Isabelle la sculpteuse. Chaque arbre coup\xE9 \xE0 mi-tronc a eu un successeur en harmonie avec le climat : sycomores, \xE9rables rouges et argent\xE9, tulipier et coulommier, kaki, lilas des indes etc. Fr\xE9d\xE9ric Godin, jardinier paysagiste a \xE9t\xE9 notre conseil. Je souhaite aux petits nouveaux une belle et longue croissance. Pour aller jusqu\u2019au bout, nous avons permis \xE0 14 de nos op\xE9r\xE9s de revivre tout au long d\u2019un chemin ludique le long de la rivi\xE8re. \xBB Le domaine des f\xE9es Myriam Eckert et Isabelle Gisler se sont rencontr\xE9es. L\u2019artiste sculpteuse conquise est alors entr\xE9e en sc\xE8ne avec sa tron\xE7onneuse. Le chantier est en cours depuis quelques mois. \xAB En phase avec Isabelle, j\u2019ai eu d\u2019entr\xE9e l\u2019envie de venir. Cela correspond \xE0 mon univers, le fantastique par les \xEAtres de la nature. Le site est magnifique, inspirant, favorisant \xE9quilibre et il y a une harmonie entre rivi\xE8re et montagne. Le th\xE8me donn\xE9 est le domaine des f\xE9es, je ne pouvais les oublier. J\u2019en ai donc cr\xE9\xE9 plusieurs. Elles semblent d\xE9j\xE0 heureuses. Ce monde fantastique laisse beaucoup de marge \xE0 l\u2019imaginaire. Je ne fais jamais de figure impos\xE9e. Mes personnages ont toujours leurs racines ancr\xE9es au sol. Ils y puisent l\u2019\xE9nergie. Tous les arbres renferment de petits tr\xE9sors. Encore faut-il le d\xE9celer et les faire ressortir. N\u2019oublions pas que le v\xE9g\xE9tal fait partie de nous. Je veux surtout que mes sculptures restent un message aux humains et rappellent que la nature est vivante, comme eux. \xBB Et chaque arbre devient une \u0153uvre selon les r\xE9v\xE9lations de Myriam qui raconte. \xAB Plusieurs f\xE9es ont \xE9merg\xE9, la f\xE9e oiseleuse vient par exemple d\u2019accueillir dans ses bras le h\xE9ron surgi de la rivi\xE8re. Quant au chevaucheur d\u2019escargot, j\u2019en r\xEAvais depuis 10 ans, il est apparu, j\u2019ai pu le faire na\xEEtre. L\u2019homme f\xE9e ? J\u2019aime bien le paradoxe masculin f\xE9minin. Pourquoi y aurait-il que des f\xE9es femmes ? Ils tiennent ensemble un enfant dans leurs bras. Le c\xF4t\xE9 f\xE9minin du masculin. La suite ? Elle va se r\xE9v\xE9ler au fur et \xE0 mesure. Deux arbres sont li\xE9s par leurs racines. J\u2019imagine d\xE9j\xE0 un couple d\u2019hommes-arbres, un couple torsad\xE9, enlac\xE9 le long de la rivi\xE8re. Les al\xE9as de la vie. \xBB Myriam, po\xE9tesse \xE0 la tron\xE7onneuse, continue de tisser, au logis des f\xE9es, sur sa toile de r\xEAve des sujets qui interpelleront le touriste une \xE0 deux d\xE9cennies, encore. ",-1),E={class:"q-px-md q-pl-lg"},J=e("h5",{class:"text-brand q-py-lg"},"Titre",-1),D=e("p",null,"Aticle paru le 16.02.2022",-1),P={__name:"Gallery",setup(k){return(C,I)=>{const a=t("q-img"),i=t("q-page");return l(),o(i,null,{default:r(()=>[e("div",c,[s(a,{src:"https://cdn.quasar.dev/img/parallax2.jpg"},{default:r(()=>[d]),_:1}),p,e("section",m,[h,g,s(a,{src:"https://cdn.quasar.dev/img/parallax2.jpg"}),_]),s(n),q,s(n),e("section",v,[f,s(a,{src:"https://cdn.quasar.dev/img/parallax2.jpg"}),x]),s(n),e("section",b,[y,j,s(a,{src:"https://cdn.quasar.dev/img/parallax2.jpg"}),L]),s(n),e("section",E,[J,s(a,{src:"https://cdn.quasar.dev/img/parallax2.jpg"}),D])])]),_:1})}}};export{P as default};
